item.description:
 &lt;h1 id=&#34;shellcode&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#shellcode&#34;&gt;#&lt;/a&gt; ShellCode&lt;/h1&gt;
&lt;h2 id=&#34;什么是shellcode&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#什么是shellcode&#34;&gt;#&lt;/a&gt; 什么是 ShellCode&lt;/h2&gt;
&lt;p&gt;其实在注入代码中就已经用到了。&lt;/p&gt;
&lt;p&gt;ShellCode 就是一段不依赖环境，放到任何地方都可以执行的机器码。&lt;/p&gt;
&lt;h2 id=&#34;shellcode编写原则&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#shellcode编写原则&#34;&gt;#&lt;/a&gt; ShellCode 编写原则&lt;/h2&gt;
&lt;ol&gt;
&lt;li&gt;
&lt;p&gt;不能有全局变量&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;不能使用常量字符串&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;不能使用系统调用&lt;/p&gt;
&lt;/li&gt;
&lt;li&gt;
&lt;p&gt;不能嵌套调用其他函数&lt;/p&gt;
&lt;/li&gt;
&lt;/ol&gt;
&lt;p&gt;如果按照这个规则写出的代码，那么代码的硬编码放到那里都能执行。&lt;/p&gt;
&lt;h2 id=&#34;shellcode编写&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#shellcode编写&#34;&gt;#&lt;/a&gt; ShellCode 编写&lt;/h2&gt;
&lt;p&gt;要编写 ShellCode 就要想办法绕过 ShellCode 原则。&lt;/p&gt;
&lt;h3 id=&#34;写代码可以不用全局变量这个不是问题&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#写代码可以不用全局变量这个不是问题&#34;&gt;#&lt;/a&gt; 写代码可以不用全局变量，这个不是问题。&lt;/h3&gt;
&lt;h3 id=&#34;不使用常量字符串&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#不使用常量字符串&#34;&gt;#&lt;/a&gt; 不使用常量字符串。&lt;/h3&gt;
&lt;p&gt;字符串的写法，示例：&lt;/p&gt;
&lt;pre&gt;&lt;code&gt;char s[] = &amp;quot;hello&amp;quot;;
000C433B A1 30 7B 0C 00       mov         eax,dword ptr ds:[000C7B30h]  
000C4340 89 45 F4             mov         dword ptr [ebp-0Ch],eax  
000C4343 66 8B 0D 34 7B 0C 00 mov         cx,word ptr ds:[000C7B34h]  
000C434A 66 89 4D F8          mov         word ptr [ebp-8],cx  

char l[] = &amp;#123; &amp;quot;hello&amp;quot; &amp;#125;;
000C434E A1 30 7B 0C 00       mov         eax,dword ptr ds:[000C7B30h]  
000C4353 89 45 E4             mov         dword ptr [ebp-1Ch],eax  
000C4356 66 8B 0D 34 7B 0C 00 mov         cx,word ptr ds:[000C7B34h]  
000C435D 66 89 4D E8          mov         word ptr [ebp-18h],cx  

char p[] = &amp;#123; &#39;h&#39;,&#39;e&#39;,&#39;l&#39;,&#39;l&#39;,&#39;o&#39;,&#39;\0&#39; &amp;#125;;//注意字符串以0x0结尾
000C4361 C6 45 D4 68          mov         byte ptr [ebp-2Ch],68h  
000C4365 C6 45 D5 65          mov         byte ptr [ebp-2Bh],65h  
000C4369 C6 45 D6 6C          mov         byte ptr [ebp-2Ah],6Ch  
000C436D C6 45 D7 6C          mov         byte ptr [ebp-29h],6Ch  
000C4371 C6 45 D8 6F          mov         byte ptr [ebp-28h],6Fh  
000C4375 C6 45 D9 00          mov         byte ptr [ebp-27h],0  

&lt;/code&gt;&lt;/pre&gt;
&lt;p&gt;在反汇编中可以看到，只有最后一种是存在堆栈中，不依赖其他，在任何地方都可以用。&lt;/p&gt;
&lt;h3 id=&#34;调用系统api&#34;&gt;&lt;a class=&#34;anchor&#34; href=&#34;#调用系统api&#34;&gt;#&lt;/a&gt; 调用系统 API&lt;/h3&gt;
&lt;p&gt;为什么不能直接写呢？&lt;/p&gt;
&lt;p&gt;因为 API 函数在 dll 文件中，是依赖 PE 的导入表的。&lt;/p&gt;
&lt;p&gt;动态获取所需系统 API 地址；shellcode 的很多操作涉及系统底层，必然调用 windows 的 API。正常情况下，windows 针对 3 环用户态程序提供 LoadLibrary 加载 dll，返回 dll 的基址。然后通过 GetProcAddress 从 dll 种获取函数基址；但这两个函数本身也是 windwos 的 API，其地址依然需要动态获取，该怎么做了？&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;动态获取 LoadLibraryW 的地址&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;先获得 &lt;code&gt;GetProcAdress&lt;/code&gt;  函数地址后就可以获得任意地址了。&lt;/p&gt;
&lt;p&gt;还记得 PEB 吗？&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;image001.png&#34; alt=&#34;&#34; /&gt;&lt;/p&gt;
&lt;p&gt;&lt;code&gt;HMODULE hModule = LoadLibrary(&amp;quot;user32.dll&amp;quot;)&lt;/code&gt;  得到的这个 &lt;code&gt;hModule&lt;/code&gt;  的值就是 &lt;code&gt;DllBase&lt;/code&gt;&lt;/p&gt;
&lt;p&gt;没错就是利用这个。先找 kernel32.dll，找到 dll 后查找其中函数的地址，这要利用 PE 导出表的知识了。&lt;/p&gt;
