&lt;p&gt;关闭 C/C++ 常规 支持仅我的代码调试 / JMC&lt;/p&gt;
&lt;p&gt;这玩意开了的话会在代码里加一些栈溢出校验函数，这些函数会在我们修复重定位 IAT 之前使用错误的地址，所以必须关掉。&lt;/p&gt;
&lt;p&gt;同理，也要把 / GS 运行时安全检查关掉，这个选项也会加入一些校验函数。这个选项在 debug 模式下没有影响，release 下就会运行时崩溃。&lt;/p&gt;
&lt;p&gt;总结一下就是，我们要把所有编译器链接器可能自己添加代码的功能尽可能关掉，不然它们在修复工作开始前就调用，就会出错。&lt;/p&gt;
&lt;p&gt;下面给出编写 shellcode 的典型配置，出自《Rootkit 系统灰色地带的潜伏者 原书第 2 版》&lt;/p&gt;
&lt;p&gt;&lt;img data-src=&#34;image002.png&#34; alt=&#34;&#34; /&gt;&lt;/p&gt;
